import React, {useState} from 'react';
import {useHistory} from 'react-router-dom'


const ChooseTest = () => {
    const history = useHistory()
    const [test, setTest] = useState('');
    const [version, setVersion] = useState('');
    const handleChange = ()=>{
        setTest(event.target.value);
        event.target.value === 'IELTSAcademic'?<IELTSAcademicVersions/>:console.log('null')
    }
    const IELTSAcademicVersions = () =>{
        return(
        <>
        <label><input onChange={handleChange} type="radio" value="./IELTSAcademic" name="version"/> Academic IELTS A</label>
        <label><input onChange={handleChange} type="radio" value="./IELTSAcademic" name="version"/> Academic IELTS B</label>
        </>)    
    }
    const IELTSGeneralVersions = () =>{
        return (
        <>
        <label><input onChange={handleChange} type="radio" value="./IELTSGeneral" name="version"/> General IELTS A</label>
        <label><input onChange={handleChange} type="radio" value="./IELTSGeneral" name="version"/> General IELTS B</label>
        </>)
    }
    const TOELFVersions = () =>{
        return (<>
        <label><input onChange={handleChange} type="radio" value="./TOELF" name="version"/> TOELF A</label>
        <label><input onChange={handleChange} type="radio" value="./TOELF" name="version"/> TOELF B</label>
        </>)
    }
    return(
        <>
        <h3>Which test are you gonna take?</h3>
        <div>
            <label><input onChange={handleChange} type="radio" value="IELTSAcademic" name="test"/> Academic IELTS </label>
            <label><input onChange={handleChange} type="radio" value="IELTSGeneral" name="test"/> General IELTS </label>
            <label><input onChange={handleChange} type="radio" value="TOELF" name="test"/> TOELF </label>
            {test==="IELTSAcademic" && <IELTSAcademicVersions/>}
        </div>

        <button onClick={()=>{history.push(test);console.log(test)}}>Start</button>
        </>
    
    )
}

export default ChooseTest;
